/**
 * get_avatar_por_id
 *
 * Imprime a descrição do site do site
 *
 * @access public
 */
if (!function_exists('get_avatar_por_id')) {
    function get_avatar_por_id($id)
    {
        switch ($id) {
            case 'bolao':
                return get_avatar_bolao();
                break;
            case 'homem':
                return get_avatar_homem();
                break;
            case 'mulher':
                return get_avatar_mulher();
                break;
            default:
                return get_avatar_bolao();
                break;
        }
    }
}
